Приложение «Кофемания Online» – удобный способ заказывать разнообразные и вкусные блюда и напитки из московских ресторанов Кофемания и получать баллы за покупки. 

В приложении вы сможете:
•	быстро заказать блюда, напитки и десерты;
•	оформить предзаказ на кулинарию и специальные позиции;
•	оформить доставку или самовывоз;
•	сделать заказ «с собой» к определенному времени или «как можно скорее»;
•	оплатить заказ банковской картой или через Apple Pay;
•	воспользоваться всеми преимуществами программы лояльности #МОЯКОФЕМАНИЯ;
•	повторить заказ в один клик;
•	посмотреть адреса и контакты ресторанов;
•	выбрать блюда с помощью удобного фильтра или найти блюдо по названию;
•	оставить отзыв и пожелания о нашей работе.

Команда Кофемании постоянно работает над улучшением приложения. Новые функции находятся в разработке и будут доступны в следующих версиях приложения.

Кофемания появилась в столице в 2001 году.

Для многих гостей Кофемания — неотъемлемая часть жизни на протяжении 20 лет. Наши гости ценят чуткий сервис, неизменное качество и вкус блюд, напитков и десертов.

В Кофемании идеально сочетаются тёплая уютная кофейня и ресторан с разнообразной кухней, собранной со всех уголков мира.

Для участников программы лояльности #МОЯКОФЕМАНИЯ действуют дополнительные бонусы:
• При оплате заказа на доставку, а также навынос в ресторанах Москвы и МО через наше мобильное приложение премиальными картами World Mastercard Black Edition® и World Elite Mastercard® дополнительные 15% баллов от суммы покупки.
• При оплате заказа в аэропортах Домодедово и Шереметьево через наше мобильное приложение премиальными картами Visa Platinum, Visa Signature или Visa Infinite дополнительные 15% баллов от суммы покупки
Подробности об этих и других акциях смотрите на сайте coffeemania.ru
